The Best By Private 213 (Best of 2013 / Private / 2014)

2013 was a banner year for Private with awards including Best Picture. Here, selected by our fans are the five best scenes from these blockbuster films. A champagne fuelled trip to a wedding dress shop turns into a passionate threesome. Oktoberfest has never seen more sausage as waitresses including Abbie Cat and Anissa Kate serve up more that beer to a thirsty and horny group of hung customers. The real life super MILF wife of a Swiss politician is taken buy three black studs who cannot believe their luck. Ian Scott and Marco Banderas stuff petite teen sensation Ashley in a DP worth watching more than a few times. And, finally, from Private's reality line, Henessy gives it all up for her pleasure and that of our fans.

